<p>Contact us or give us a call to discover how we can help.</p>
<div class="row">
    <div class="col-lg-12">
        <div class="form-group">
            <label for="contact-name">Your name *</label>
            [text* your-name id:contact-name class:form-control]
        </div>
    </div>
    <div class="col-lg-12">
        <div class="form-group">
            <label for="contact-email">Your email address *</label>
            [email* your-email id:contact-email class:form-control]
        </div>
    </div>
    <div class="col-lg-12">
        <div class="form-group">
            <label for="contact-subject">Subject</label>
            [text your-subject id:contact-subject class:form-control]
        </div>
    </div>
    <div class="col-lg-12">
        <div class="form-group">
            <label for="contact-message">Message *</label>
            [textarea* your-message id:contact-message rows:3 class:form-control]
        </div>
    </div>
    <div class="col-lg-12">
        <div class="form-group">
            [submit class:btn class:btn-primary "Send Message"]
        </div>
    </div>
</div>
